"""# Slicing of a List

In Python List, there are multiple ways to print the whole List with all the elements, but to print a specific range of elements from the list, we use Slice operation. Slice operation is performed on Lists with the use of a colon(:).

To print elements from beginning to a range use [: Index],

to print elements from end-use [:-Index],

to print elements from specific Index till the end use [Index:],

to print elements within a range, use [Start Index:End Index] and

to print the whole List with the use of slicing operation, use [:].

Further, to print the whole List in reverse order, use [::-1].

Note  To print elements of List from rear end, use Negative Indexes.
"""

# Python program to demonstrate Removal of elements in a List

# Creating a List
List = ['A','B','C','D','E','F',
		'G','H','I','J','K','L']
print("Initial List: ")
print(List)

# Print elements of a range using Slice operation

Sliced_List = List[3:8]
print("\nSlicing elements in a range 3-8: ")
print(Sliced_List)

# Print elements from a pre-defined point to end
Sliced_List = List[5:]
print("\nElements sliced from 5th "
	"element till the end: ")
print(Sliced_List)

# Printing elements from beginning till end
Sliced_List = List[:]
print("\nPrinting all elements using slice operation: ")
print(Sliced_List)

L_range  = range(1,5)
L_range
list(L_range)

# Print elements from beginning
# to a pre-defined point using Slice
Sliced_List = List[:-2]
print("\nElements sliced till 6th element from last: ")
print(Sliced_List)

# Print elements of a range
# using negative index List slicing
Sliced_List = List[-6:-1]
print("\nElements sliced from index -6 to -1")
print(Sliced_List)

# Printing elements in reverse
# using Slice operation
Sliced_List = List[::-1]
print("\nPrinting List in reverse: ")
print(Sliced_List)

